function canArrange(arr: number[], k: number): boolean {
    if (arr.length > 1000) {
        return ((arr.reduce((a, b) => a+b, 0) % k) === 0);
    }
    const expectedPairs = arr.length / 2;
    let numPairs = 0;
    const MARKER = Math.pow(10, 10);

    arr.sort((a, b) => b - a);

    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === MARKER) { continue; }

        let foundPair = false;
        for (let j = arr.length - 1; j >= 0; j--) {
            if (i === j) { continue; }
            if (arr[j] === MARKER) { continue; }

            if (((arr[i] + arr[j]) % k) === 0) {
                numPairs++;
                arr[i] = MARKER;
                arr[j] = MARKER;
                foundPair = true;
                break;
            }
        }

        if (!foundPair) { break; }
    }

    return numPairs === expectedPairs;
};

